column13:
@The Young Turds 
You are defending it from "super dangerous" Immigrants That Have Slightly Different Skin Color oh wow, such heroics. Your defense is TOTALLY not a waste of time, you guys.

Buncha crybabies is what you are, making mountains out of molehills you yourselves made up.

@The Young Turds
Your thinly veiled white supremacy makes your statement laughable at best and worthless in any other regard. 
You and your kind will be remembered as a speed-bump to a better world.

@Matt : lol, I think you have a misunderstanding of how news works.  They're private businesses (normally), so getting viewers is #1, then second comes ideology.  This story involves politics and a mega-famous celebrity.  You not liking her music doesn't make it not news-worthy.

I agree with the importance of a bit of what you said, to be fair, and I'll add that I'd like to see some of those topics covered by new angles.  For instance, young people should be told about how liberal arts (and any major in certain colleges) are ill-advised to major in if you care about money.  

I don't like how certain news topics are overplayed too, like mass shootings; they barely inflate murder count, and such aren't nearly as important as certain other topics like, as you mentioned, global warming.
